import React, {Component} from 'react'
import logo from '../pictures/arcade-logo.jpg'

class Navbar extends Component {
    render () {
        return(
            <div>
                <ul>
                    <li>Hopeful Casino</li>
                    <li>Coin Flipper</li>
                </ul>
            </div>
        )
    }
}

export default Navbar;
